import React, { useState, useEffect } from 'react';
import Http from '../../http/apiService';
import { StyleFileIndex } from '../../components/files/StyleFileIndex'
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { Button } from '@material-ui/core';
import { useHistory } from "react-router-dom";
import NavbarIndex from '../../components/nav-bar/IndexNavbar'
import HomePage from '../HomePage';

const UserIndex = ()=>{
    let history = useHistory();
    const [data, setData] = useState([]);
    const GetFile = async () => {
        const url ='files/file/'+localStorage.getItem('userName')
        const resp = await Http.getSth(url)
        setData(resp.data);
    }

    const downLoad=async(id)=>{
        
        const url = '/files/download/'+ id;
        window.open(url,"_blank");
    }

    const viewFile=(id)=>{      
        history.push(`/file/${id}`);
    }

    useEffect(() => {
        GetFile();
    }, []);
    function FormRow() {
        return (
            <React.Fragment>
                {data.map((element) => {
                    return (
                        <Grid item xs={4}>
                            <Paper className="box">
                                <p>File Name: {element.name}</p>
                                <p>User: {element.userName}</p>
                                <p>Comment: {element.comment}</p>
                                <Button className="btn-download" onClick={() => downLoad(element.id)}>DownLoad</Button>
                                <Button className="btn-download" onClick={() => viewFile(element.id)}>View File</Button>
                            </Paper>
                        </Grid>
                    )
                }
                )
                }
            </React.Fragment>
        );
    }
    return (
        <StyleFileIndex className="container-fluid">
            <NavbarIndex/>
            <div className="file-view">
                <Grid container spacing={1}>
                    <Grid container item xs={12} spacing={2}>
                        <FormRow/>
                    </Grid>
                </Grid>
            </div>
        </StyleFileIndex>
    )
}

export default UserIndex;
